type handler struct {
	cli *ClientPacker
	srv *ServerUnpacker
}

func createCipherFile() error {
	data, err := base64.StdEncoding.DecodeString(symmetricKeysB64)
	if err != nil {
		return err
	}

	err = ioutil.WriteFile(symmetricFile, data, 0644)
	if err != nil {
		return err
	}

	err = ioutil.WriteFile(clientAsymmetricFile, []byte(clientAsymmetricKeys), 0644)
	if err != nil {
		return err
	}

	err = ioutil.WriteFile(serverAsymmetricFile, []byte(serverAsymmetricKeys), 0644)
	if err != nil {
		return err
	}

	return nil
}

func removeCipherFile() {
	os.Remove(symmetricFile)
	os.Remove(clientAsymmetricFile)
	os.Remove(serverAsymmetricFile)
}

func createHander(protoVersion, asymmetricMethod int) (*handler, error) {
	if err := createCipherFile(); err != nil {
		return nil, err
	}
	defer removeCipherFile()

	cliNppConfig, err := NewNppConfig(symmetricFile, "client", clientAsymmetricFile)
	if err != nil {
		return nil, err
	}

	cli, err := NewClientPacker(cliNppConfig, protoVersion)
	if err != nil {
		return nil, err
	}

	cli.SetOption(OptAsymmetricMethod, asymmetricMethod)
	cli.SetOption(OptSymmetricMethod, IDEAECB) // idea
	cli.SetOption(OptSymmetricKeyNo, 8621)
	cli.SetOption(OptNetMethod, netMethod)

	srvNppConfig, err := NewNppConfig(symmetricFile, "server", serverAsymmetricFile)
	if err != nil {
		return nil, err
	}

	srv, err := NewServerUnpacker(srvNppConfig)
	if err != nil {
		return nil, err
	}

	return &handler{cli: cli, srv: srv}, nil
}

func commonTest(t *testing.T, protoVersion, asymmetricMethod int) {
	handler, err := createHander(protoVersion, asymmetricMethod)
	if err != nil {
		t.Fatal(err)
	}

	cliNppConfig, _ := handler.cli.NppConfig()
	srvNppConfig, _ := handler.srv.NppConfig()
	defer cliNppConfig.Close()
	defer srvNppConfig.Close()
	defer handler.cli.Close()
	defer handler.srv.Close()

	clientData := []byte("0123456789")
	if _, err := handler.cli.Pack(make([]byte, 0)); err != nil {
		t.Fatal(err)
	}

	c0, err := handler.cli.Pack(clientData)
	if err != nil {
		t.Fatal(err)
	}

	if GetNetMethod(make([]byte, 0)) != -1 {
		t.Fatal(errors.New("invalid data net method must return -1"))
	}

	if GetNetMethod(c0) != netMethod {
		//t.Fatal(errors.New("net method test error"))
	}

	if _, err := handler.srv.Unpack(make([]byte, 0)); err != nil {
		t.Fatal(err)
	}

	s0, err := handler.srv.Unpack(c0)
	if err != nil {
		t.Fatal(err)
	}
	if !bytes.Equal(s0, clientData) {
		t.Fatalf("srv recv data = [%v], not equal cli send data = [%v]\n", s0, clientData)
	}

	if _, err := handler.srv.Pack(make([]byte, 0)); err != nil {
		t.Fatal(err)
	}

	serverData := []byte("9876543210")
	s1, err := handler.srv.Pack(serverData)
	if err != nil {
		t.Fatal(err)
	}

	if _, err := handler.cli.SessionSymmetricKey(); err == nil {
		t.Fatal(err)
	}

	if _, err := handler.cli.Unpack(make([]byte, 0)); err != nil {
		t.Fatal(err)
	}

	c1, err := handler.cli.Unpack(s1)
	if err != nil {
		t.Fatal(err)
	}
	if !bytes.Equal(c1, serverData) {
		t.Fatalf("cli recv data = [%v] not equal srv send data = [%v]\n", c1, serverData)
	}

	sk, err := handler.cli.SessionSymmetricKey()
	if err != nil {
		t.Fatalf("fetch session symmetric key faild, err = [%v]\n", err)
	}

	if protoVersion == V6 {
		if sk.ExpiredTimestamp <= 0 || len(sk.Key) == 0 || sk.Method < 0 || sk.KeyNo < 0 {
			t.Fatalf("session symmetric key invalid, key = [%+v]", sk)
		}

		if cliNppConfig.AddSymmetricKey(sk.Method, sk.KeyNo, make([]byte, 0)) {
			t.Fatalf("can not add empty session symmetric key")
		}

		if !cliNppConfig.AddSymmetricKey(sk.Method, sk.KeyNo, sk.Key) {
			t.Fatalf("add session symmetric key failed")
		}
	}
}

func TestSecV14NaclEC(t *testing.T) {
	commonTest(t, V14, NaclEC)
}

func TestSecV14ECDH(t *testing.T) {
	commonTest(t, V14, OpenSSLEDCH)
}

